webpackJsonp([0xe6de1675a48b],{687:function(n,a){n.exports={data:{markdownRemark:{html:'<p>You can manage email notifications you receive from programs you belong to in <strong>Settings > Programs</strong>. On the Programs page, you can view a list of programs you belong to along with the visibility of that program on your public profile as well as your notification settings.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/manage-notifications-1-e56b45f97324fced1cca299906ac8f2f-7607e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 43.9223697650664%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="manage-notifications-1"\n        title=""\n        src="/static/manage-notifications-1-e56b45f97324fced1cca299906ac8f2f-2f183.png"\n        srcset="/static/manage-notifications-1-e56b45f97324fced1cca299906ac8f2f-67829.png 125w,\n/static/manage-notifications-1-e56b45f97324fced1cca299906ac8f2f-5c59f.png 250w,\n/static/manage-notifications-1-e56b45f97324fced1cca299906ac8f2f-2f183.png 500w,\n/static/manage-notifications-1-e56b45f97324fced1cca299906ac8f2f-c93e8.png 750w,\n/static/manage-notifications-1-e56b45f97324fced1cca299906ac8f2f-7607e.png 979w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>To change your notification preferences for a program:</p>\n<ol>\n<li>\n<p>Click on the link below <strong>Notifications</strong> for that program. The link will either say <em>Enabled</em> or <em>Disabled</em> depending on your existing notification preference.</p>\n</li>\n<li>\n<p>A window will show where you can set your notifications.\nIf you want to disable notifications, the <strong>Disable Notifications</strong> screen will show where you can unsubscribe from reports.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/manage-notifications-3-644ae177806060704bbcfb7056799939-ad87e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 51.010101010101%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="manage-notifications-3"\n        title=""\n        src="/static/manage-notifications-3-644ae177806060704bbcfb7056799939-2f183.png"\n        srcset="/static/manage-notifications-3-644ae177806060704bbcfb7056799939-67829.png 125w,\n/static/manage-notifications-3-644ae177806060704bbcfb7056799939-5c59f.png 250w,\n/static/manage-notifications-3-644ae177806060704bbcfb7056799939-2f183.png 500w,\n/static/manage-notifications-3-644ae177806060704bbcfb7056799939-c93e8.png 750w,\n/static/manage-notifications-3-644ae177806060704bbcfb7056799939-ad87e.png 990w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>If you want to enable notifications, the <strong>Enable Notifications</strong> screen will show where you can subscribe to reports.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/manage-notifications-2-540e06cbf51f48551c04211d79e0b75e-ad87e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 50.70707070707071%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="manage-notifications-2"\n        title=""\n        src="/static/manage-notifications-2-540e06cbf51f48551c04211d79e0b75e-2f183.png"\n        srcset="/static/manage-notifications-2-540e06cbf51f48551c04211d79e0b75e-67829.png 125w,\n/static/manage-notifications-2-540e06cbf51f48551c04211d79e0b75e-5c59f.png 250w,\n/static/manage-notifications-2-540e06cbf51f48551c04211d79e0b75e-2f183.png 500w,\n/static/manage-notifications-2-540e06cbf51f48551c04211d79e0b75e-c93e8.png 750w,\n/static/manage-notifications-2-540e06cbf51f48551c04211d79e0b75e-ad87e.png 990w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n</li>\n</ol>\n<p>If you disable your notifications, you\'ll start receiving notifications again when you:</p>\n<ul>\n<li>Interact with a report</li>\n<li>Are assigned a report</li>\n<li>Are mentioned in a report</li>\n</ul>',frontmatter:{title:"Manage Notifications",id:"hackers/manage-notifications",path:"/hackers/manage-notifications.html",description:null}}},pathContext:{}}}});
